    .container {
      background: rgba(0, 0, 0, 0.6);
      padding: 20px 30px;
      border-radius: 12px;
      text-align: center;
      color: white;
      width: 90%;
      max-width: 400px;
    }

    #quote {
      font-size: 1.4rem;
      margin-bottom: 20px;
      min-height: 80px;
    }

    button {
      padding: 10px 20px;
      font-size: 1rem;
      border: none;
      border-radius: 8px;
      cursor: pointer;
      background: #ff7fbf;
      color: white;
      font-weight: bold;
    }

    button:hover {
      background: #ff4fa3;
    }
  </style>

<body>
  <div class="container">
    <div id="quote">Click the button for a quote </div>
    <button onclick="newQuote()">New Quote</button>
  </div>

  <script>
    const quotes = [
      "I love you so much <3",
      "You are my number 1",
      "I would not leave you",
      "Cheryl you are the best",
      "I am sorry sayang",
      "Please do not leave me",
      "I will be better"
    ];

    function newQuote() {
      const q = quotes[Math.floor(Math.random() * quotes.length)];
      document.getElementById('quote').textContent = q;
    }
  </script>
</body>
</html>
